import React from 'react';
// import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
// import NavigationMenu from './NavigationMenu';
// import { NavLinks } from 'react-router-dom';
import Logo from './Logo';
import Navigation from './Navigation';
import './Header.css';
import socialFacebook from '../assets/images/social-facebook.png';

class Header extends React.Component {
	
	render(){
		return (
			<header>
				<div className = "row-wrap-header">
					<div className="container">
						<div className = "row">
							<div className="col-md-3 ">
								<div className= "contacts-header">
									<span>124213</span>
									<span>907707</span>
								</div>	
							</div>
							<div className = "col-md-2 offset-md-7">
								<ul>
									<li><a href=""><img src={socialFacebook} /></a></li>
								</ul>
							</div>
						</div>
					</div>
				</div>
				<div className="row-wrap-header row-wrap-header_main">
					<div className="container">
						<div className = "row">	
							<div className="col-md-2">
								<Logo />
							</div>
							<div className="col-md-5">
								<nav className="header-navigation">
									<Navigation />
								</nav>
							</div>
							<div className="col-md-2 offset-md-3">
								Navigation controls
							</div>
						</div>
					</div>
				</div>
			</header>
		)
	}
}

export default Header;
